import React from 'react';
import ReactDOM from 'react-dom/client';
import './index.css';

import { SearchBar } from './pages/searchbar';
import { getSearchBarClass } from './helperfunctions/getSearchBarclass';

import { Router } from './router';

//Logo
import logo from './images/logo.png';


//Logo
function Logo() {
    return (
        <div className='grow'>
            <img src={logo} alt='' className='logo'/>
        </div>
    );
}



//Future implementation
// function EvaluationApp() {
//     return(
//         <div>
            
//         </div>
//     )
// }

//Home Page
class Home extends React.Component {
    constructor () {
        super()
        this.state = {
          page: 'Survey'
        }

        this.handleHomeButton = this.handleHomeButton.bind(this);
        this.handleSurveyButton = this.handleSurveyButton.bind(this);
      }
      render () {
        return (
          <div style={{height: '100%'}}>
            <header>
                <button className='btn-logo' onClick={this.handleHomeButton}><Logo /></button>
                <SearchBar searchBarClass={getSearchBarClass(this.state.page === 'HomeCarousel')}/>
                <button className='btnSurvey' onClick={this.handleSurveyButton}>SURVEY</button>                
            </header>
            <Router page={this.state.page}/>
          </div>
        )
      }

      handleHomeButton(){
        this.setState({
            page: 'HomeCarousel'
        });
      }
      handleSurveyButton(){
        this.setState({
          page: 'Survey'
        })
      }
}

const root = ReactDOM.createRoot(document.getElementById("root"));
root.render(<Home />);
